CREATE TABLE IF NOT EXISTS DOCUMENTTYPE (ID INTEGER PRIMARY KEY  AUTOINCREMENT  NOT NULL  UNIQUE , DOCUMENTTYPE VARCHAR NOT NULL , ACTIVEIND INTEGER NOT NULL  DEFAULT 1);
CREATE TABLE IF NOT EXISTS activation ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"ACTIVATIONKEY" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVATIONDATE" DATETIME  NULL DEFAULT NULL ,"STARTDATE" DATE  NULL DEFAULT NULL ,"ENDDATE" DATE  NULL DEFAULT NULL ,"ACTIVATIONDAYS" INT  NULL DEFAULT NULL ,"ACTIVEIND" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "appointments" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"DATE" DATE  NOT NULL  ,"SLOTID" INT  NOT NULL  ,"PATIENTID" INT  NOT NULL  ,"DOCTORID" INT  NOT NULL  ,"TREATMENTID" INT  NULL DEFAULT NULL ,"COMMENTS" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"STATUS" INT  NULL DEFAULT NULL ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "checkup" ("checkUpId" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"patientId" INT  NOT NULL  ,"treatment" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"dignosis" TEXT  NULL  COLLATE BINARY,"priscription" TEXT  NULL  COLLATE BINARY,"fees" FLOAT(0,0)  NULL DEFAULT NULL ,"consultantingDoctorFee" FLOAT(0,0)  NULL DEFAULT 0 ,"nextVisitDate" DATETIME  NULL DEFAULT NULL ,"date" DATETIME  NULL DEFAULT NULL ,"dentistName" VARCHAR(50)  NOT NULL  COLLATE BINARY,"refferedBy" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"bp" VARCHAR(10)  NULL DEFAULT 'NULL' COLLATE BINARY,"pulse" VARCHAR(10)  NULL DEFAULT 'NULL' COLLATE BINARY,"weight" VARCHAR(10)  NULL DEFAULT 'NULL' COLLATE BINARY,"activeind" INT  NULL DEFAULT NULL ,CONSTRAINT `FK_checkup` FOREIGN KEY (`patientId`) REFERENCES patients (`PATIENTID`) ON DELETE RESTRICT ON UPDATE RESTRICT);
CREATE TABLE IF NOT EXISTS "city" ("cityId" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"cityName" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"activeind" INT  NULL DEFAULT NULL );
CREATE TABLE IF NOT EXISTS "clinic" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"ADDRESS" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"CITY" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"CONTACT" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"MORNINGSTARTTIME" TIME  NULL DEFAULT NULL ,"MORNINGENDTIME" TIME  NULL DEFAULT NULL ,"EVENINGSTARTTIME" TIME  NULL DEFAULT NULL ,"EVENINGENDTIME" TIME  NULL DEFAULT NULL ,"ACTIVEIND" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "doctors" ("DOCTORID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(50)  NOT NULL  COLLATE BINARY,"TYPE" VARCHAR(10)  NOT NULL  COLLATE BINARY,"BIRTHDAY" DATE  NULL DEFAULT NULL ,"GENDER" NVARCHAR(0)  NOT NULL  COLLATE BINARY,"PHOTO" BLOB  NULL  ,"ADDRESS" VARCHAR(60)  NULL DEFAULT NULL COLLATE BINARY,"CITY" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"TELEPHONE" VARCHAR(14)  NULL DEFAULT NULL COLLATE BINARY,"MOBILE" VARCHAR(14)  NULL DEFAULT NULL COLLATE BINARY,"EMAIL" VARCHAR(60)  NULL DEFAULT NULL COLLATE BINARY,"AGE" INT  NOT NULL  ,"DEGREE" VARCHAR(50)  NULL DEFAULT 'null' COLLATE BINARY,"REGISTRATIONNO" VARCHAR(50)  NULL DEFAULT 'null' COLLATE BINARY,"SPECIALIZATION" VARCHAR(50)  NULL DEFAULT 'null' COLLATE BINARY,"ACTIVEIND" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "employees" ("EMPLOYEEID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(50)  NOT NULL  COLLATE BINARY,"BIRTHDAY" DATE  NULL DEFAULT NULL ,"GENDER" NVARCHAR(0)  NOT NULL  COLLATE BINARY,"PHOTO" BLOB  NULL  ,"ADDRESS" VARCHAR(60)  NULL DEFAULT NULL COLLATE BINARY,"CITY" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"TELEPHONE" VARCHAR(14)  NOT NULL  COLLATE BINARY,"MOBILE" VARCHAR(14)  NULL DEFAULT NULL COLLATE BINARY,"EMAIL" VARCHAR(30)  NULL DEFAULT NULL COLLATE BINARY,"AGE" INT  NULL DEFAULT NULL ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "expensecategory" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"EXPENSECATEGORY" VARCHAR(30)  NOT NULL  COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "expenses" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"EXPENSECATEGORY" VARCHAR(30)  NOT NULL  COLLATE BINARY,"AMOUNT" INT  NOT NULL  ,"DATE" DATETIME  NOT NULL  ,"NOTES" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "lab" ("LABID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"CITY" VARCHAR(25)  NULL DEFAULT NULL COLLATE BINARY,"CONTACT" VARCHAR(15)  NULL DEFAULT NULL COLLATE BINARY,"ADDRESS" VARCHAR(25)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "labwork" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"PATIENTID" INT  NOT NULL  ,"CHECKUPID" INT  NOT NULL  ,"LABID" INT  NOT NULL  ,"WORK" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"UL" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"UR" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"LL" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"LR" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"STATUS" INT  NOT NULL  ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 ,CONSTRAINT `FK_labwork_checkup` FOREIGN KEY (`CHECKUPID`) REFERENCES checkup (`checkUpId`) ON DELETE RESTRICT ON UPDATE RESTRICT,CONSTRAINT `FK_labwork_lab` FOREIGN KEY (`LABID`) REFERENCES lab (`LABID`) ON DELETE RESTRICT ON UPDATE RESTRICT,CONSTRAINT `FK_labwork_patient` FOREIGN KEY (`PATIENTID`) REFERENCES patients (`PATIENTID`) ON DELETE RESTRICT ON UPDATE RESTRICT);
CREATE TABLE IF NOT EXISTS "labworkname" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(25)  NOT NULL  COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "medicines" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"TYPE" VARCHAR(30)  NOT NULL  COLLATE BINARY,"NAME" VARCHAR(100)  NOT NULL  COLLATE BINARY,"STRENGTH" VARCHAR(10)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NULL DEFAULT 1 ,CONSTRAINT `FK_medicines` FOREIGN KEY (`TYPE`) REFERENCES medicinetype (`MEDICINETYPE`) ON DELETE RESTRICT ON UPDATE RESTRICT);
CREATE TABLE IF NOT EXISTS "medicinetype" ("MEDICINETYPE" VARCHAR(30) PRIMARY KEY NOT NULL  COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "odontograma" ("cod_odontograma" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"PATIENTID" INT  NULL DEFAULT NULL ,"nome_pac" VARCHAR(60)  NOT NULL  COLLATE BINARY,"18_odon" TEXT  NULL  COLLATE BINARY,"17_odon" TEXT  NULL  COLLATE BINARY,"16_odon" TEXT  NULL  COLLATE BINARY,"15-55_odon" TEXT  NULL  COLLATE BINARY,"14-54_odon" TEXT  NULL  COLLATE BINARY,"13-53_odon" TEXT  NULL  COLLATE BINARY,"12-52_odon" TEXT  NULL  COLLATE BINARY,"11-51_odon" TEXT  NULL  COLLATE BINARY,"41-81_odon" TEXT  NULL  COLLATE BINARY,"42-82_odon" TEXT  NULL  COLLATE BINARY,"43-83_odon" TEXT  NULL  COLLATE BINARY,"44-84_odon" TEXT  NULL  COLLATE BINARY,"45-85_odon" TEXT  NULL  COLLATE BINARY,"46_odon" TEXT  NULL  COLLATE BINARY,"47_odon" TEXT  NULL  COLLATE BINARY,"48_odon" TEXT  NULL  COLLATE BINARY,"28_odon" TEXT  NULL  COLLATE BINARY,"27_odon" TEXT  NULL  COLLATE BINARY,"26_odon" TEXT  NULL  COLLATE BINARY,"65-25_odon" TEXT  NULL  COLLATE BINARY,"64-24_odon" TEXT  NULL  COLLATE BINARY,"63-23_odon" TEXT  NULL  COLLATE BINARY,"62-22_odon" TEXT  NULL  COLLATE BINARY,"61-21_odon" TEXT  NULL  COLLATE BINARY,"71-31_odon" TEXT  NULL  COLLATE BINARY,"72-32_odon" TEXT  NULL  COLLATE BINARY,"73-33_odon" TEXT  NULL  COLLATE BINARY,"74-34_odon" TEXT  NULL  COLLATE BINARY,"75-35_odon" TEXT  NULL  COLLATE BINARY,"36_odon" TEXT  NULL  COLLATE BINARY,"37_odon" TEXT  NULL  COLLATE BINARY,"38_odon" TEXT  NULL  COLLATE BINARY,CONSTRAINT `FK_odontograma` FOREIGN KEY (`PATIENTID`) REFERENCES patients (`PATIENTID`) ON DELETE RESTRICT ON UPDATE RESTRICT);
CREATE TABLE IF NOT EXISTS "patients" ("PATIENTID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(50)  NOT NULL  COLLATE BINARY,"CASEID" VARCHAR(10)  NOT NULL  COLLATE BINARY,"BIRTHDAY" DATE  NULL DEFAULT NULL ,"GENDER" NVARCHAR(0)  NOT NULL  COLLATE BINARY,"PHOTO" BLOB  NULL  ,"ADDRESS" VARCHAR(60)  NULL DEFAULT NULL COLLATE BINARY,"CITY" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"TELEPHONE" VARCHAR(14)  NULL DEFAULT NULL COLLATE BINARY,"MOBILE" VARCHAR(14)  NULL DEFAULT NULL COLLATE BINARY,"EMAIL" VARCHAR(60)  NULL DEFAULT NULL COLLATE BINARY,"AGE" INT  NOT NULL  ,"PREMEDICALHISTORY" VARCHAR(200)  NULL DEFAULT NULL COLLATE BINARY,"CREATEDTM" DATETIME  NULL DEFAULT NULL ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "premedicalhistory" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"DISCRIPTION" VARCHAR(50)  NOT NULL  COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "priscription" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"CHECKUPID" INT  NOT NULL  ,"MEDICINETYPE" VARCHAR(10)  NOT NULL  COLLATE BINARY,"MEDICINENAME" VARCHAR(50)  NOT NULL  COLLATE BINARY,"MEDICINESTRENGTH" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"FREQUENCY" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,"DURATION" VARCHAR(20)  NULL DEFAULT NULL COLLATE BINARY,CONSTRAINT `FK_priscription_checkup` FOREIGN KEY (`CHECKUPID`) REFERENCES checkup (`checkUpId`) ON DELETE RESTRICT ON UPDATE RESTRICT,CONSTRAINT `FK_priscription_medicinetype` FOREIGN KEY (`MEDICINETYPE`) REFERENCES medicinetype (`MEDICINETYPE`) ON DELETE RESTRICT ON UPDATE RESTRICT);
CREATE TABLE IF NOT EXISTS "referedby" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"NAME" VARCHAR(50)  NOT NULL  COLLATE BINARY,"CITY" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"CONTACT" VARCHAR(15)  NULL DEFAULT NULL COLLATE BINARY,"ADDRESS" VARCHAR(50)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "settings" ("KEYNAME" VARCHAR(50) PRIMARY KEY NOT NULL  COLLATE BINARY UNIQUE,"VALUE" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NULL DEFAULT 1 ,"EDITABLE" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "timeslot" ("ID" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"START_TIME" TIME  NOT NULL  ,"END_TIME" TIME  NOT NULL  ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "tokens" ("KEYNAME" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY UNIQUE,"VALUE" VARCHAR(100)  NULL DEFAULT NULL COLLATE BINARY,"ACTIVEIND" INT  NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "treatments" ("treatmentId" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"treatmentName" VARCHAR(50)  NOT NULL  COLLATE BINARY,"treatmentDescription" TEXT  NULL  COLLATE BINARY,"treatmentCharges" FLOAT(0,0)  NULL DEFAULT NULL ,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );
CREATE TABLE IF NOT EXISTS "users" ("userId" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL  ,"name" VARCHAR(45)  NOT NULL  COLLATE BINARY,"loginId" VARCHAR(16)  NOT NULL  COLLATE BINARY,"password" VARCHAR(8)  NOT NULL  COLLATE BINARY,"userType" NVARCHAR(0)  NOT NULL  COLLATE BINARY,"ACTIVEIND" INT  NOT NULL DEFAULT 1 );


CREATE INDEX 'FK_Dentist_checkup' ON 'checkup' (`dentistName` DESC);
CREATE INDEX 'FK_checkup' ON 'checkup' (`patientId` DESC);
CREATE INDEX 'FK_labwork_checkup' ON 'labwork' (`CHECKUPID` DESC);
CREATE INDEX 'FK_labwork_lab' ON 'labwork' (`LABID` DESC);
CREATE INDEX 'FK_labwork_patient' ON 'labwork' (`PATIENTID` DESC);
CREATE INDEX 'FK_medicines' ON 'medicines' (`TYPE` DESC);
CREATE INDEX 'FK_odontograma' ON 'odontograma' (`PATIENTID` DESC);
CREATE INDEX 'FK_priscription_checkup' ON 'priscription' (`CHECKUPID` DESC);
CREATE INDEX 'FK_priscription_medicinetype' ON 'priscription' (`MEDICINETYPE` DESC);













